import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';

export default function Plans() {
    return (
        <>
            <Container fluid className="text-left">
                <Row>
                    <Col>
                        <h3>Best Saving Plans in India</h3>
                    </Col>
                </Row>
            </Container>
        </>
    );
}
